import React, { useState } from "react";
import Select from "react-select";
import { useForm } from "react-hook-form";

const options = [
  { value: "1316168077", label: "juan" },
  { value: "1316166977", label: "Melanie" },
  { value: "1316168577", label: "Vanilla" },
];

const AddRegistro = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();
  const [file, setFile] = useState(null);
  const handleChange = (e) => {
    e.preventDefault();
    setFile(e.target.files[0]);
    console.log(file);
  };
  const addRegistro = (data) => console.log(data);
  return (
    <form
      onSubmit={handleSubmit(addRegistro)}
      className="flex flex-col bg-white w-auto p-4 justify-between"
    >
      <label className="mt-4 mb-1" htmlFor="Paciente">
        Paciente
      </label>
      <Select
        id="Paciente"
        options={options}

        {...register("Paciente", {
          require: { value: true, message: "Debe elegir un paciente" },
          minLength:{value:1,message: "Debe elegir un paciente"}
        })}
      />
      <span className="Warring">
        {errors.Paciente && errors.Paciente.message}
      </span>
      <label className="mt-4 mb-1" htmlFor="Examen">
        Examen
      </label>
      <Select
        id="Examen"
        className="w-96"
        options={options}
        {...register("Examen", {
          require: { value: true, message: "Debe elegir un Examen" },
        })}
      />
      <span className="Warring">{errors.Examen && errors.Examen.message}</span>
      <label className="mt-4 mb-1" htmlFor="Archivo">
        Subir Pdf
      </label>
      <input
        onChange={handleChange}
        type="file"
        name="Archivo"
        id="Archivo"
        accept="aplication/pdf"
      />
      <label className="mt-4 mb-1" htmlFor="Fecha">
        Fecha
      </label>
      <input
        type="date"
        name="Fecha"
        id="Fecha"
        {...register("Fecha", {
          require: { value: true, message: "Fecha es Obligatoria" },
        })}
      />
      <span className="Warring">{errors.Fecha && errors.Fecha.message}</span>
      <input className="w-2/3 my-6 ml-16" type="submit" value="Agregar" />
    </form>
  );
};

export default AddRegistro;
